  this.kind = kind;
  this.flags = 0;
  this.exp1 = exp1;
  this.exp2 = exp2;
  this.s = s;
  this.c = c;
  this.min = min;
  this.max = max;
  this.digits = digits;
  this.from = from;
  this.to = to;
}

